(1784, 1, '2024-03-27 12:59:12', '0000-00-00 00:00:00', 'L\'histoire de Paul Atreides, jeune homme aussi doué que brillant, voué à connaître un destin hors du commun qui le dépasse totalement. Car, s\'il veut préserver l\'avenir de sa famille et de son peuple, il devra se rendre sur Dune, la planète la plus dangereuse de l\'Univers. Mais aussi la seule à même de fournir la ressource la plus précieuse capable de décupler la puissance de l\'Humanité. Tandis que des forces maléfiques se disputent le contrôle de cette planète, seuls ceux qui parviennent à dominer leur peur pourront survivre…', 'Dune - Première partie', '', 'draft', 'closed', 'closed', '', '', '', '', '2024-03-27 12:59:12', '0000-00-00 00:00:00', '', 0, 'http://localhost/wordpress/?post_type=products&p=1784', 0, 'products', '', 0),
