(1764, 1, '2024-03-26 14:27:05', '2024-03-26 14:27:05', 'Un avion de ligne s\'immobilise dangereusement près du bord d\'un ravin, les passagers et l\'équipage survivants étant piégés dans une poche d\'air. Leur réserve d\'air s\'épuisant rapidement, une lutte cauchemardesque pour la survie s\'engage alors que des dangers les guettent de toutes parts.', 'No Way Up', '', 'publish', 'closed', 'closed', '', 'no-way-up', '', '', '2024-03-26 14:27:26', '2024-03-26 14:27:26', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1764', 0, 'products', '', 0),
(1765, 1, '2024-03-26 14:27:04', '2024-03-26 14:27:04', 'Paul Atréides se rallie à Chani et aux Fremen tout en préparant sa revanche contre ceux qui ont détruit sa famille. Alors qu\'il doit faire un choix entre l\'amour de sa vie et le destin de la galaxie, il devra néanmoins tout faire pour empêcher un terrible futur que lui seul peut prédire.', 'Dune : Deuxième partie', '', 'publish', 'closed', 'closed', '', 'dune-deuxieme-partie', '', '', '2024-03-26 14:27:26', '2024-03-26 14:27:26', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1765', 0, 'products', '', 0),
(1766, 1, '2024-03-26 14:27:03', '2024-03-26 14:27:03', 'Quand les intrigues de ses romans d\'espionnage rappellent un peu trop les activités d\'une sombre organisation criminelle, Elly Conway, romancière introvertie, se retrouve immergée avec son chat dans le monde réel des espions, où tout n\'est que faux-semblant.', 'Argylle', '', 'publish', 'closed', 'closed', '', 'argylle', '', '', '2024-03-26 14:27:26', '2024-03-26 14:27:26', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1766', 0, 'products', '', 0),
(1767, 1, '2024-03-26 14:27:03', '2024-03-26 14:27:03', '« Pendant ce temps, dans un autre univers... » Dans une variation du genre classique, Madame Web raconte les origines de l\'une des plus énigmatiques héroïnes des bandes dessinées Marvel. Le suspense met en vedette Dakota Johnson dans le rôle de Cassandra Webb, une ambulancière de Manhattan ayant des dons de voyance. Contrainte de faire face à des révélations sur son passé, elle se lie d\'amitié avec trois jeunes femmes destinées à un avenir de superhéroïnes… si elles parviennent à survivre aux dangers du présent.', 'Madame Web', '', 'publish', 'closed', 'closed', '', 'madame-web', '', '', '2024-03-26 14:27:26', '2024-03-26 14:27:26', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1767', 0, 'products', '', 0),
(1768, 0, '2024-03-25 14:40:39', '2024-03-25 14:40:39', '', 'kDp1vUBnMpe8ak4rjgl3cLELqjU.jpg', '', 'inherit', 'open', 'closed', '', 'kdp1vubnmpe8ak4rjgl3clelqju-jpg', '', '', '2024-03-25 14:40:39', '2024-03-25 14:40:39', '', 0, 'http://localhost/wordpress/kdp1vubnmpe8ak4rjgl3clelqju-jpg/', 0, 'attachment', 'image/jpeg', 0),
(1769, 1, '2024-03-26 14:27:02', '2024-03-26 14:27:02', 'La routine règne chez les Colvert. Si papa Mack préfère garder les siens bien à l’abri dans leur étang de la Nouvelle-Angleterre, maman Pam veut changer les choses et faire découvrir le monde à leurs deux enfants, Dax l’ado et Gwen la cadette. Après qu’une famille de canards migrateurs s’est enflammée pour des récits parlant d’endroits très lointains, Pam persuade Mack d’embarquer la famille dans un long périple, depuis la ville de New York jusque sous les tropiques, en Jamaïque. Tandis que les Colvert s’envolent vers le Sud pour l’hiver, leurs projets bien rodés tombent rapidement à l’eau. Une expérience qui les pousse alors à étendre leurs horizons, à s’ouvrir à de nouveaux amis et à aller au-delà de leurs espoirs les plus fous, tout en apprenant davantage sur chacun et sur soi-même', 'Migration', '', 'publish', 'closed', 'closed', '', 'migration', '', '', '2024-03-26 14:27:26', '2024-03-26 14:27:26', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1769', 0, 'products', '', 0),
(1770, 1, '2024-03-26 14:27:01', '2024-03-26 14:27:01', 'L\'ancienne équipe de méchants de Megamind, le Doom Syndicate, est de retour. Notre héros bleu nouvellement couronné doit maintenant conserver les apparences maléfiques jusqu\'à ce qu\'il puisse rassembler ses amis (Roxanne, Ol\' Chum et Keiko) pour empêcher ses anciens coéquipiers maléfiques de lancer Metro City sur la Lune.', 'Megamind vs. the Doom Syndicate', '', 'publish', 'closed', 'closed', '', 'megamind-vs-the-doom-syndicate', '', '', '2024-03-26 14:27:26', '2024-03-26 14:27:26', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1770', 0, 'products', '', 0),
(1771, 1, '2024-03-26 14:27:00', '2024-03-26 14:27:00', 'Une fable étonnante ayant pour héroïne Bella Baxter, une jeune femme ramenée à la vie par un savant brillant et peu conventionnel. Désireuse de connaître le monde, Bella s\'embarque dans une aventure tourbillonnante sur plusieurs continents. Étrangère aux préjugés de son époque, Bella fonce tête baissée dans sa quête d\'égalité et d\'émancipation.', 'Pauvres créatures', '', 'publish', 'closed', 'closed', '', 'pauvres-creatures', '', '', '2024-03-26 14:27:26', '2024-03-26 14:27:26', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1771', 0, 'products', '', 0),
(1772, 1, '2024-03-26 14:26:59', '2024-03-26 14:26:59', 'Lorsqu’une mission spéciale de la Delta Force tourne terriblement mal, un pilote de drone de l’armée de l’air, Reaper ne dispose que de 48 heures pour réussir ce qui est devenu une opération de sauvetage hors de contrôle. Sans armes et sans autre moyen de communication que le drone en vol, la mission au sol se transforme soudainement en un affrontement mortel lorsque l’ennemi découvre l’équipe.', 'Land of Bad', '', 'publish', 'closed', 'closed', '', 'land-of-bad', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1772', 0, 'products', '', 0),
(1773, 1, '2024-03-26 14:26:58', '2024-03-26 14:26:58', 'Célébrez la vie et la musique d\'une icône qui a inspiré plusieurs générations grâce à son message d\'amour, de paix et d\'unité. Dans ce film puissant et inspirant, découvrez comment Bob Marley a surmonté l\'adversité et comment sa musique révolutionnaire a changé le monde.', 'Bob Marley : One Love', '', 'publish', 'closed', 'closed', '', 'bob-marley-one-love', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1773', 0, 'products', '', 0),
(1774, 1, '2024-03-26 14:26:56', '2024-03-26 14:26:56', 'Connor est sorti de prison et travaille comme homme de ménage dans un centre social. Il a coupé les ponts avec son ancien complice, Garrett, et essaie de filer droit jusqu\'au jour où il est bien obligé d\'aider Pav, une ado de 14 ans, à échapper aux griffes d\'une meute de policiers corrompus sous les ordres du sergent King. Alors que King et ses hommes se servent de nouveaux robots chiens pour retrouver Pav, Connor n\'a d\'autre choix que de redemander de l\'aide à Garrett et à sa bande… mais comment faire confiance à l\'homme qui l\'a fait mettre en prison ?', 'Code 8 : Partie II', '', 'publish', 'closed', 'closed', '', 'code-8-partie-ii', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1774', 0, 'products', '', 0),
(1775, 1, '2024-03-26 14:26:41', '2024-03-26 14:26:41', 'Lorsqu\'il découvre qu\'il n\'est que le troisième fugitif le plus recherché de Taïwan, un criminel ambitieux se donne pour objectif de devancer les deux premiers.', 'The Pig, the Snake and the Pigeon', '', 'publish', 'closed', 'closed', '', 'the-pig-the-snake-and-the-pigeon', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1775', 0, 'products', '', 0),
(1776, 1, '2024-03-26 14:26:38', '2024-03-26 14:26:38', 'Après leur confrontation explosive, Godzilla et Kong doivent se réunir pour affronter une menace colossale cachée dans notre monde, qui remet en question leur existence même - et la nôtre. Plongez dans l\'histoire de ces Titans, leurs origines et les mystères de l\'île du Crâne et au-delà, et découvrez la bataille mythique qui a contribué à forger ces êtres extraordinaires et les a liés à l\'humanité pour toujours.', 'Godzilla x Kong : Le nouvel Empire', '', 'publish', 'closed', 'closed', '', 'godzilla-x-kong-le-nouvel-empire', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1776', 0, 'products', '', 0),
(1777, 1, '2024-03-26 14:26:35', '2024-03-26 14:26:35', 'Dalton, un ancien combattant de l\'UFC tente d\'échapper à son sombre passé et à son penchant pour la violence. Il est repéré par Frankie, propriétaire d\'un relais routier dans les Keys de Floride. Elle l\'engage comme nouveau videur dans l\'espoir d\'empêcher un gang violent, travaillant pour le patron du crime Brandt, de détruire son bar bien-aimé.', 'Road House', '', 'publish', 'closed', 'closed', '', 'road-house', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1777', 0, 'products', '', 0),
(1778, 1, '2024-03-26 14:26:22', '2024-03-26 14:26:22', 'Bea et Ben ont tout du couple parfait, mais après un premier rendez-vous idéal, un incident refroidit leur attirance réciproque jusqu\'à leurs retrouvailles inattendues lors d\'un mariage en Australie. Ils font alors ce que n\'importe quel adulte mature ferait dans cette situation : prétendre être en couple.', 'Tout sauf toi', '', 'publish', 'closed', 'closed', '', 'tout-sauf-toi', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1778', 0, 'products', '', 0),
(1779, 1, '2024-03-26 14:26:22', '2024-03-26 14:26:22', 'Lorsque la découverte d\'un ancien artefact libère une force maléfique, les Ghostbusters, nouveaux et anciens, doivent unir leurs forces pour protéger leur maison et sauver le monde d\'une seconde ère glaciaire.', 'S.O.S. Fantômes : La Menace de Glace', '', 'publish', 'closed', 'closed', '', 's-o-s-fantomes-la-menace-de-glace', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1779', 0, 'products', '', 0),
(1780, 1, '2024-03-26 14:26:22', '2024-03-26 14:26:22', 'En 1942, convaincus que l\'Allemagne nazie est en train de développer une arme nucléaire, les États-Unis initient, dans le plus grand secret, le \"Projet Manhattan\" destiné à mettre au point la première bombe atomique de l’histoire. Pour piloter ce dispositif, le gouvernement engage J. Robert Oppenheimer, brillant physicien, qui sera bientôt surnommé \"le père de la bombe atomique\". C\'est dans le laboratoire ultra-secret de Los Alamos, au cœur du désert du Nouveau-Mexique, que le scientifique et son équipe mettent au point une arme révolutionnaire dont les conséquences, vertigineuses, continuent de peser sur le monde actuel…', 'Oppenheimer', '', 'publish', 'closed', 'closed', '', 'oppenheimer', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1780', 0, 'products', '', 0),
(1781, 1, '2024-03-26 14:26:22', '2024-03-26 14:26:22', 'Cash essaie de mener une vie honnête et tranquille, en s\'occupant de sa nièce Savannah dans les collines du comté d\'Odim. Lorsque la sadique \"Queenpin Big Cat\" qui tient la ville sous sa coupe, lui réclame son aide, Cash apprend qu\'il est capable de tout, même de tuer, pour protéger la ville et la seule famille qui lui reste.', 'Red Right Hand', '', 'publish', 'closed', 'closed', '', 'red-right-hand', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1781', 0, 'products', '', 0),
(1761, 1, '2024-03-25 14:24:16', '2024-03-25 14:24:16', '', '', '', 'publish', 'closed', 'closed', '', '1761', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1761', 0, 'products', '', 0),
(1762, 1, '2024-03-26 14:27:06', '2024-03-26 14:27:06', 'Shifu annonce à Po qu\'il doit devenir le nouveau Chef Spirituel, et ainsi laisser sa place à un autre Dragon Guerrier. Cette nouvelle ne plaît pas du tout au panda, qui s\'épanouissait dans ce rôle de protecteur. Avant de léguer son Bâton de la Sagesse à un autre, il doit accomplir une dernière mission, soit empêcher la Caméléonne, une sorcière pouvant se métamorphoser en n\'importe quelle créature, d\'étendre son pouvoir jusqu\'à la vallée de la Paix. Il sera aidé dans sa tâche par Zhen, une renarde rusée et une habile voleuse, qui sait où se cache le lézard machiavélique.', 'Kung Fu Panda 4', '', 'publish', 'closed', 'closed', '', 'kung-fu-panda-4', '', '', '2024-04-22 08:36:58', '2024-04-22 08:36:58', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1762', 0, 'products', '', 0),
(1763, 1, '2024-03-26 14:27:05', '2024-03-26 14:27:05', 'Une jeune femme docile accepte d\'épouser un beau prince et réalise que la famille royale a choisi de la sacrifier en remboursement d\'une dette ancienne. Jetée dans une grotte abritant un dragon cracheur de feu, elle ne pourra compter que sur son intelligence et sur son courage pour survivre.', 'La Demoiselle et le dragon', '', 'publish', 'closed', 'closed', '', 'la-demoiselle-et-le-dragon', '', '', '2024-03-26 14:27:26', '2024-03-26 14:27:26', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1763', 0, 'products', '', 0),
