(1782, 1, '2024-03-26 14:26:22', '2024-03-26 14:26:22', 'Une jeune femme tente de retrouver ses origines après avoir été abandonnée alors qu\'elle était enfant dans un cimetière enveloppée dans un tissu aux symboles sataniques, mais alors qu\'elle se rapproche des réponses, un esprit malveillant lui dit de partir.', 'Leave', '', 'publish', 'closed', 'closed', '', 'leave', '', '', '2024-03-26 14:27:27', '2024-03-26 14:27:27', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1782', 0, 'products', '', 0),
