(1798, 1, '2024-05-06 10:13:14', '2024-05-06 10:13:14', '<!-- wp:paragraph -->\n<p>Deux frères, Sam et Dean Winchester, chasseurs de créatures surnaturelles, sillonnent les États-Unis à bord d\'une Chevrolet Impala noire de 1967 et enquêtent sur des phénomènes paranormaux (souvent issus du folklore, des superstitions, mythes et légendes urbaines américaines, mais aussi des monstres surnaturels tels que les fantômes, loups-garous, démons, vampires…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li></li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->', 'Supernatural', '', 'publish', 'closed', 'closed', '', 'supernatural', '', '', '2024-05-07 11:10:50', '2024-05-07 11:10:50', '', 0, 'http://localhost/wordpress/?post_type=products&#038;p=1798', 0, 'products', '', 0),
